import React from "react";

const PostItem = () => {
  return (
    <div class="item">
      <div class="content">
        <a class="header">Cute Dog</a>
        <div class="description">
          <p></p>
          <p></p>
        </div>
        <div class="extra">
          <i class="green check icon"></i>
          121 Votes
        </div>
      </div>
    </div>
  );
};

export default PostItem;
